import { useState } from "react";

const Logout = ({user, logout}) => {


    function handleLogout() {
        fetch("/api/logout", {
          method: "DELETE",
        }).then(() => logout(''));
      }

    return (
        <div>
            <button onClick={() => handleLogout()}>Logout</button>
            <p>Current User:{user}</p>
        </div>

    )
}

export default Logout;
